import React from "react";
import ReplayIcon from '@mui/icons-material/Replay';

const Writecontent = () => {
  return (
    <>
      <div className="min-h-[30%] bg-white mt-6 w-[35%] relative rounded-md shadow-md shadow-slate-400 mx-auto">
        <input
          className="text-xl font-semibold absolute top-3 left-3 outline-0"
          placeholder="Add Input Title"
        ></input>
        <textarea className="text-md absolute top-14 w-[90%] max-h-full outline-0 ml-4"></textarea>
        <ReplayIcon sx={{ fontSize: 15 }} className="absolute bg-blue-600 text-white rounded-full right-7 top-20"/>
      </div>
    </>
  );
};

export default Writecontent;
